CREATE DEFINER=`root`@`localhost` PROCEDURE `spGetBinpackResults`(IN this_problem_id BIGINT(20))
BEGIN
  DECLARE maxScore DOUBLE;
  DECLARE numScores BIGINT(20);
  DECLARE keyIndex BIGINT(20);
  SELECT COUNT(num_bins) INTO numScores FROM results WHERE problem_id = this_problem_id;
  SET keyIndex = 20;
  IF numScores < 20 THEN SET keyIndex = numScores;
  END IF;
  SET keyIndex = keyIndex - 1;
  SELECT num_bins INTO maxScore FROM results WHERE problem_id = this_problem_id ORDER BY num_bins DESC LIMIT keyIndex,1;
  
  SELECT participant_id, `timestamp`, num_bins FROM results
  WHERE num_bins >= maxScore AND problem_id = this_problem_id
  ORDER BY num_bins ASC, `timestamp` ASC;
  
END ;;
